[278]: Item 7. Management’s Discussion and Analysis of Financial Condition and Results of Operations
[279]: The following discussion and analysis of our financial condition and results of operations should be read in conjunction with our consolidated financial statements and related notes included elsewhere in this annual report on Form 10-K. We intend for this discussion to provide the reader with information that will assist in understanding our consolidated financial statements, the changes in certain key items in those financial statements from period to period, and the primary factors that accounted for those changes, as well as how certain accounting principles affect our consolidated financial statements. The discussion also provides information about the financial results of the various segments of our business to provide a better understanding of how those segments and their results affect the financial condition and results of operations of our company as a whole.
[432]: REVENUE RECOGNITION The Company derives income from the sale of footwear, apparel and accessories and royalties earned from licensing the Skechers brand. The Company recognizes sales revenue, net of estimated returns and excluding sales and value added taxes. Revenue is recognized at point of sale or upon shipment, the point in time where control transfers to the customer. Wholesale sales are recognized upon shipment. Direct-to-consumer sales are recognized at the point of sale for transactions with customers at the Company’s retail stores and recognized upon shipment for sales made through its websites. Sales are reduced by an estimate of customer merchandise returns, which is calculated based on historical experience. The Company reserves for potential disputed amounts or chargebacks from its customers. The Company’s chargeback reserve is based on a factors such as historical trends, customer behavior and nature of the chargeback.
[433]: ALLOWANCE FOR BAD DEBTS The Company provides a reserve for estimated losses that may result from its customers’ inability to pay. The Company determines the amount of the reserve by analyzing known uncollectible accounts, aged receivables, historical losses and its customers’ credit-worthiness. Allowances for bad debts are recorded to general and administrative expenses.
