[821]: Table element - Text before table: Regulatory balancing account revenue Regulatory balancing account revenue is revenue related to revenue mechanisms authorized in California by the California Public Utilities Commission (CPUC), which the Company recognizes as revenue when it is objectively determinable, probable of recovery and expected to be collected within 24 months following the end of the accounting period. Regulatory balancing account revenues are not considered contracts with customers. To the extent that revenue is estimated to be collectible beyond 24 months, recognition is deferred. Due to a delay in resolution of Cal Water's most recent general rate case filing in July of 2021 (2021 GRC), the Company did not recognize a benefit from regulatory revenue mechanisms in 2023. For 2022, the Company's authorized regulatory revenue mechanisms included the Water Revenue Adjustment Mechanism (WRAM). The WRAM decoupled revenue from the volume of the sales and allowed the Company to recognize the adopted level of volumetric revenues. The variance between adopted volumetric revenues and actual billed volumetric revenues for metered accounts was recorded as regulatory balancing account revenue. The WRAM concluded on December 31, 2022. Regulatory balancing accounts also includes revenue that is recognized for balancing accounts when it is probable that future recovery of previously incurred costs or future refunds that are to be credited to customers will occur through the ratemaking process. These mechanisms, such as the Modified Cost Balancing Account (MC

