[1258]: Segment Reporting We operate in a single segment, which is to provide capital return to stockholders by maximizing the potential value of our portfolio of royalties and innovative healthcare assets. Our Chief Operating Decision Maker (“CODM”) is our Chief Executive Officer. The CODM allocates resources and evaluates the performance of Innoviva at the consolidated level using information about our revenues, operating results and other key financial data as needed. Our revenues are generated primarily from our collaborative arrangements and royalty payments from GSK, located in Great Britain. We also generate revenue from net product sales of GIAPREZA ® , XERAVA ® , and XACDURO ® . Refer to Note 3, “Revenue Recognition”, for more information on our revenues for the periods presented. Our long-term assets are located within the United States.
