[1260]: Variable Interest Entities The primary beneficiary of a variable interest entity (“VIE”) is required to consolidate the assets and liabilities of the VIE. When we obtain a variable interest in another entity, we assess at the inception of the relationship and upon occurrence of certain significant events whether the entity is a VIE and, if so, whether we are the primary beneficiary of the VIE based on our power to direct the activities of the VIE that most significantly impact the VIE’s economic performance and our obligation to absorb losses or the right to receive benefits from the VIE that could potentially be significant to the VIE. To assess whether we have the power to direct the activities of a VIE that most significantly impact the VIE’s economic performance, we consider all the facts and circumstances, including our role in establishing the VIE and our ongoing rights and responsibilities. This assessment includes identifying the activities that most significantly impact the VIE’s economic performance and identifying which party, if any, has power over those activities. In general, the parties that make the most significant decisions affecting the VIE (management and representation on the Board of Directors) and have the right to unilaterally remove those decision-makers are deemed to have the power to direct the activities of a VIE. To assess whether we have the obligation to absorb losses of the VIE or the right to receive benefits from the VIE that could potentially be significant to the VIE, we consider all of our economic interests that are deemed to be variable interests in the VIE. This assessment requires us to apply judgment in determining whether these interests, in the aggregate, are considered potentially significant to the VIE.
