[1020]: Financial Highlights
[1021]: • Royalty revenue: Fourth quarter 2023 gross royalty revenue from GSK was $69.6 million and full year was $252.7 million, compared to $54.7 million for the fourth quarter of 2022 and $253.4 million for the full year 2022.
[1022]: 78
[1023]: Table of Contents
[1024]: • Net Product Sales: Fourth quarter 2023 net product sales and license revenue were $19.7 million, which included $13.1 million from GIAPREZA ® , $5.2 million from XERAVA ® , and $1.4 million from XACDURO ® , compared to $14.6 million for the fourth quarter of 2022. Full year 2023 net product sales and license revenue was $71.6 million, which included $41.3 million from GIAPREZA ® , $17.3 million from XERAVA ® , $2.0 million from XACDURO ® , and $11.0 million in milestone payments from our partners.
[1025]: • Equity and long-term investments: Fourth quarter and full year 2023 change in fair values of equity and long-term investments of $25.5 million and $88.5 million, respectively, was primarily attributable to Armata share price appreciation.
[1102]: Total royalty revenue, net, decreased to $311.6 million for the year ended December 31, 2022, compared to the year ended December 31, 2021. The decrease in total net royalty revenue was primarily due to the sale of our ownership interest in TRC, which received royalties stemming from sales of TRELEGY ® ELLIPTA ® . Royalties for RELVAR ® /BREO ® ELLIPTA ® and ANORO ® ELLIPTA ® decreased due to pricing pressures in the U.S. market and foreign currency rate changes.
[1103]: Net Product Sales
[1104]: Net product sales for the year ended December 31, 2023 was $60.6 million, consisting of net sales of GIAPREZA ® , XERAVA ® and XACDURO ® for $41.3 million, $17.3 million, and $2.0 million, respectively. We derived approximately 91% of our net product sales for the same period from customers located in the U.S. and 9% from the rest of the world.
[1105]: Net product sales we recognized from the date of acquisition of La Jolla, which occurred on August 22, 2022, to December 31, 2022 was $19.7 million, consisting of net sales of GIAPREZA ® and XERAVA ® for $14.2 million and $5.5 million, respectively. We derived approximately 96% of our net product sales for the same period from customers located in the U.S. and 4% from the rest of the world.
