[222]: Table of Contents payment, discounts for price adjustments, product returns, allowances, and certain advertising and promotional costs, including consumer coupons, which are variable consideration and are recorded as a reduction of product sales revenue in the same period the related product sales are recorded. Such estimates are calculated using historical averages adjusted for any expected changes due to current business conditions and experience. Revenue for net product sales is recognized at a point in time when products are delivered to or picked up by the customer, as designated by customers’ purchase orders, as discussed in Note 1 of the Company’s Notes to Consolidated Financial Statements. ​ Provisions for bad debts are recorded as selling, marketing and administrative expenses. Write-offs of bad debts did not exceed 0.1% of net product sales in each of 2023, 2022 and 2021, and accordingly, have not been significant to the Company’s financial position or results of operations. ​ Intangible assets ​ The Company’s intangible assets consist primarily of goodwill and acquired trademarks. In accordance with accounting guidance, goodwill and other indefinite-lived assets, trademarks, are not amortized, but are instead subjected to annual testing for impairment unless certain triggering events or circumstances are noted. The Company performs its annual impairment review and assessment as of December 31. All trademarks have been assessed by management to have indefinite lives because they are expected to generate cash flows indefinitely. The Company reviews and assesses certain trademarks (non-amortizable intangible assets) for impairment by comparing the fair value of each trademark with its carrying value. Current accounting guidance provides entities an option of performing a qualitative assessment (a "step-zero" test) before performing a quantitative analysis. If the entity determines, on the basis of certain qualitative factors, that it is more-likely-than-not that the intangibles (goodwill and certain trademarks) are not impaired, the entity would not need to proceed to the two step impairment testing process (quantitative analysis) as prescribed in the guidance. During fourth quarter 2023, the Company performed a “step zero” test of its goodwill and certain trademarks, and concluded that there was no impairment based on this guidance. ​ The Company determines the fair value of certain trademarks using discounted cash flows and estimates of royalty rates. If the carrying value exceeds fair value, such trademarks are considered impaired and are reduced to fair value. The Company utilizes third-party professional valuation firms to assist in the determination of valuation of certain trademarks. Impairments have not generally been material to the Company’s historical operating results. Cash flow projections require the Company to make assumptions and estimates regarding the Company’s future plans, including sales projections and profit margins, market based discount rates, competitive factors, and economic conditions; and the Company’s actual results and conditions may differ over time. A change in the assumptions relating to the impairment analysis including but not limited to a reduction in projected cash flows, the use of a different discount rate to discount future cash flows or a different royalty rate applied to such trademarks, could cause impairment in the future. ​ Customer incentive programs, advertising and marketing ​ Advertising and marketing costs are recorded in the period to which such costs relate. The Company does not defer the recognition of any amounts on its consolidated balance sheet with respect to such costs. The expected cost of future payments to customers for incentives and other trade promotional programs is recorded at the time sale as a reduction of Net product sales. The liabilities associated with these programs are reviewed quarterly and adjusted if the expected utilization rate differs from management’s original estimates. Such adjustments have not historically been material to the Company’s operating results. ​ Valuation of long-lived assets ​ Long-lived assets, primarily property, plant and equipment, are reviewed for impairment as events or changes in business circumstances occur indicating that the carrying value of the asset may not be recoverable. The estimated cash flows produced by assets or asset groups, are compared to the asset carrying value to determine whether impairment exists. Such estimates involve considerable management judgment and are based upon assumptions about expected future operating performance. As a result, actual cash flows could differ from management’s estimates due to changes in business conditions, operating performance, and economic and competitive conditions. Such impairments have not historically been material to the Company’s operating results. 21
