[769]: The preparation of consolidated financial statements in conformity with U.S. GAAP requires management to make estimates and assumptions that affect the amounts reported in our consolidated financial statements and related notes. We base our estimates on historical experience and on various other assumptions that we believe to be reasonable under the circumstances, as provided in the section titled “Management’s Discussion and Analysis of Financial Condition and Results of Operations” in this Annual Report on Form 10-K. The results of these estimates form the basis for making judgments about the carrying values of assets, liabilities, and equity, and the amount of revenue and expenses that are not readily apparent from other sources. In addition, when we acquire businesses, we make judgments about how best to account for their revenue, assets and liabilities in our condensed consolidated financial statements. These judgments may be based on limited information, estimates and various assumptions, which we may revisit as we more fully integrate such businesses into our company. Critical accounting policies and estimates used in preparing our consolidated financial statements include those related to: revenue recognition; write-down of supplies; the useful lives of property, plant and equipment; the recoverability of long-lived assets; the incremental borrowing rate for leases; the estimation of the fair value of intangible assets and contingent consideration; variable interest entity assessment; impairment of equity investment, at cost; stock options; income tax uncertainties, including a valuation allowance for deferred tax assets; reserve on accounts receivable and contingencies. Our operating results may be adversely affected if our assumptions change or if actual circumstances differ from those in our assumptions, which could cause our operating results to fall below the expectations of securities analysts and investors, resulting in a decline in the price of our common stock.
[1134]: 2. Summary of Significant Accounting Policies
[1135]: Basis of Presentation The Company's consolidated financial statements have been prepared in accordance with accounting principles generally accepted in the United States, or U.S. GAAP. The consolidated financial statements include the accounts of the Company and its wholly-owned subsidiaries. All intercompany accounts and transactions have been eliminated in consolidation. Reclassifications Certain prior period balances have been reclassified to conform to current period presentation of the Company’s consolidated financial statements and accompanying notes. Such reclassifications have no effect on previously reported results of operations, accumulated deficit, subtotals of operating, investing or financing cash flows or consolidated balance sheet totals; however, for the year ended December 31, 2022, the Company reclassified $ 3.3 million of impairment of long-lived assets from the general and administrative expense caption in the consolidated statements of operations. Use of Estimates The preparation of consolidated financial statements in conformity with U.S. GAAP requires management to make estimates and assumptions that affect the reported amounts of assets and liabilities and disclosure of contingent liabilities as of the date of the consolidated financial statements and the reported amounts of revenue and expenses during the reporting period. Significant items subject to such estimates include: revenue recognition; the useful lives of property, plant and equipment; the recoverability of long-lived assets; the incremental borrowing rates for leases; accounting for acquisitions; the estimation of the fair value of intangible assets and contingent consideration; stock based compensation; income tax uncertainties, including a valuation allowance for deferred tax assets; credit related losses on investments; and allowance for credit losses and contingencies. The Company bases these estimates on historical and anticipated results, trends, and various other assumptions that the Company believes are reasonable under the circumstances, including assumptions as to future events. These estimates
[903]: Product Revenue
[904]: Our products consist of the Prosigna breast cancer assay, the nCounter Analysis System, related diagnostic kits, and services. We recognize product revenue when control of the promised goods is transferred to our customers, in an amount that reflects the consideration expected to be received in exchange for those products. This process involves identifying the contract with a customer, determining the performance obligations in the contract, determining the contract price, allocating the contract price to the distinct performance obligations in the contract, and recognizing revenue when the performance obligations have been satisfied. A performance obligation is considered distinct from other obligations in a contract when it provides a benefit to the customer, either on its own or together with other resources that are readily available to the customer, and is separately identified in the contract. Performance obligations are considered satisfied once we have transferred control of a product to the customer, meaning the customer has the ability to use and obtain the benefit of the product. We recognize product revenue for satisfied performance obligations only when there are no uncertainties regarding payment terms or transfer of control. Shipping and handling costs incurred for product shipments are charged to our customers and included in product revenue. Revenue is presented net of the taxes that are collected from customers and remitted to governmental authorities.
[923]: Cost of Product Revenue
[924]: Our cost of product revenue consists primarily of costs of purchasing instruments and diagnostic kits from third-party contract manufacturers, installation, warranty, service and packaging and delivery costs. In addition, cost of product revenue includes royalty costs for licensed technologies included in our products and labor expenses. As our Prosigna test kits are sold in various configurations with different number of tests, our product cost per test will vary based on the specific kit configuration purchased by customers.
[925]: Cost of Biopharmaceutical and Other Revenue
[926]: Our cost of biopharmaceutical and other revenue are the costs of performing activities under arrangements that require us to perform research and development, commercialization, contract manufacturing and development, and previously included contract testing services on behalf of a customer. This cost is mainly composed of compensation expense, manufacturing and laboratory supplies and pass-through costs.
