[750]: Gross Profit and Gross Margin
[751]: Gross profit consists of our net revenues less cost of goods sold. Gross margin is gross profit expressed as a percentage of our net revenues. Our cost of goods sold primarily consists of the cost of raw materials including ingredients and packaging, co-manufacturing fees, direct and indirect labor and certain supply costs, inbound and internal shipping and handling costs incurred in manufacturing our products, warehouse storage fees, plant and equipment overhead, depreciation and amortization expense, provision for excess and obsolete inventory, and accelerated depreciation on write-offs and disposals of certain fixed assets. Under certain circumstances, our cost of goods sold may also include underutilization and/or termination fees associated with our co-manufacturing agreements. Gross profit and gross margin in the year ended December 31, 2023 as compared to the prior-year periods were positively impacted by lower manufacturing costs including lower depreciation expense resulting from a change in the estimated useful lives of certain of our large manufacturing equipment. See Note 6 , Property, Plant and Equipment, to the Notes to Consolidated Financial Statements included elsewhere in this report.
