[1067]: Earnings (Loss) Per Share Earnings (loss) per share (“EPS”) represents net income available to common stockholders divided by the weighted average number of common shares outstanding for the period. Diluted EPS represents net income available to common stockholders divided by the weighted-average number of common shares outstanding, inclusive of the dilutive impact of potential common shares outstanding during the period. Such potential common shares include options, unvested restricted stock, restricted stock units (“RSUs”) and contracts classified as assets or liabilities that are required or assumed to be share-settled under the two-class method. The Company calculates basic and diluted EPS available to common stockholders in conformity with the two-class method required for companies with participating securities. Pursuant to ASU 2020-06, the Company applies the more dilutive of the if-converted method and the two-class method to its Notes. Computation of EPS for the years ended December 31, 2021 and 2020 also excludes adjustments under the two-class method relating to a liability classified, share-settled obligation to an executive officer to deliver a variable number of shares based on a fixed monetary amount because the shares to be delivered are not participating securities as they do not have voting rights and are not entitled to participate in dividends until they are issued. In periods when the Company records net loss, all potential common shares are excluded in the computation of EPS because their inclusion would be anti-dilutive. See Note 12 . Prepaid Expenses Prepaid expenses primarily include prepaid insurance and other prepaid vendor costs, which are expensed in the period to which they relate. Prepaid expenses are included under the caption “Prepaid assets and other assets” in consolidated balance sheets and were $ 8.3 million, and $ 14.5 million as of December 31, 2023 and 2022, respectively. Investment in Joint Venture The Company uses the equity method of accounting to record transactions associated with its joint venture when the Company shares in joint control of the investee. Investment in joint venture is not consolidated but is recorded in “Investment in unconsolidated joint venture” in the Company’s consolidated balance sheet. The Company recognizes its portion of the investee’s results in “Equity in losses of unconsolidated joint venture” in its consolidated statement of operations. The Company eliminates its proportionate interest in any intra-entity profits or losses in the inventory of the investee at the end of the reporting period and recognizes its portion of the profit and losses when realized by the investee. Selling, General and Administrative (“SG&A”) Expenses SG&A expenses are primarily comprised of selling, marketing expenses and administrative expenses, including personnel and related expenses, share-based compensation, outbound shipping and handling costs, non-manufacturing lease expense, depreciation and amortization expense on non-manufacturing and non-research and development assets, charges related to asset write-offs including loss on sale and write-down of fixed assets, consulting fees and other non-production operating expenses. Marketing and selling expenses include advertising costs, share-based compensation awards to brand ambassadors, costs associated with consumer promotions, product donations, product samples and sales aids incurred to acquire new customers, retain existing customers and build brand awareness. Administrative expenses include expenses related to management, accounting, legal, IT and other office functions. Advertising costs are expensed as incurred. Advertising costs in the years ended December 31, 2023, 2022 and 2021 were $ 17.2 million, $ 20.6 million and $ 12.1 million, respectively. Non-advertising related components of the Company’s total marketing expenditures primarily include costs associated with consumer promotions, product sampling and sales aids, which are also included in SG&A. Shipping and Handling Costs
[800]: Gross profit and gross margin in 2023 as compared to 2022 were negatively impacted by lower net revenues per pound, higher inventory provision per pound and higher manufacturing costs including depreciation, partially offset by lower logistics costs and lower materials costs per pound. The increase in inventory provision included $38.0 million in non-cash charges resulting from our Global Operations Review. In addition, gross profit and gross margin in 2023 included a $4.4 million in contract termination costs associated with a certain co-manufacturing agreement and $6.1 million in additional provision for inventory associated with a large QSR customer. In 2023, gross profit and gross margin benefited by $19.0 million and 23%, respectively, as a result of a change in the estimated useful lives of certain of our large manufacturing equipment, as compared to those same measures calculated using our previous estimated useful lives. See Note 6 , Property, Plant and Equipment , to the Notes to Consolidated Financial Statements included elsewhere in this report.
