[569]: Revenue
[570]: Our revenue as historically been derived from our collaboration agreements, under which we may receive product sales revenue, royalties, and license fees, as well as development and sales milestones and other contingent payments. We recognize revenue when we transfer promised goods or services to our collaboration partners.
[571]: • Product sales and Cost of goods sold: Product sales include predominantly fixed price manufacturing and supply agreements with our collaboration partners and are the result of firm purchase orders from those partners. Accordingly, the revenue recognized in a given period is based solely on the demand and requirements of our collaboration partners and is not ratable throughout the year. We expect product sales to increase for 2024 as compared to 2023 due to increased demand from our partners with a corresponding increase in cost of goods sold.
