[291]: Table of Contents NORTHWEST BIOTHERAPEUTICS, INC. Notes to the Consolidated Financial Statements As of December 31, 2023 and 2022, the Company did not consolidate any VIE’s as the Company has concluded that it is not the primary beneficiary. Use of Estimates In preparing consolidated financial statements in conformity with U.S. GAAP, management is required to make estimates and assumptions that affect the reported amounts of assets and liabilities and disclosure of contingent assets and liabilities at the date of the financial statements, as well as the reported amounts of expenses during the reporting period. Due to inherent uncertainty involved in making estimates, actual results reported in future periods may be affected by changes in these estimates. On an ongoing basis, the Company evaluates its estimates and judgments, including valuing equity securities in share-based payment arrangements, estimating the fair value of financial instruments recorded as derivative liabilities, useful lives of depreciable assets and whether impairment charges may apply. The Company bases its estimates on historical experience and on various other assumptions that it believes to be reasonable under the circumstances, the results of which form the basis for making judgments about the carrying values of assets and liabilities and the reported amounts of revenues and expenses that are not readily apparent from other sources. Actual results could differ from those estimates. Concentration of Credit Risk Financial instruments that potentially subject the Company to concentration of credit risk consist of cash accounts in a financial institution, which at times may exceed the Federal depository insurance coverage (“FDIC”) of $ 250,000 . As of December 31, 2023, of the total $ 2.1 million in cash and cash equivalents, $ 36,000 was held by foreign subsidiaries. As of December 31, 2022, of the total $ 7.0 million in cash and cash equivalents, $ 0.4 million was held by foreign subsidiaries. The Company had not experienced losses on these accounts and management believes the Company is not exposed to significant risks on such accounts. Property, Plant and Equipment Property and equipment are stated at cost. Depreciation and amortization are provided for using straight-line methods, in amounts sufficient to charge the cost of depreciable assets to operations over their estimated service lives. Repairs and maintenance costs are charged to operations as incurred. Costs for capital assets not yet placed into service are capitalized as construction in progress on the consolidated balance sheets and will be depreciated once placed into service. In October 2021, approval was received from the UK Human Tissue Authority (“HTA”) of a license for collection and processing of human cells and tissues for medical purposes at the Company’s Sawston, UK facility. In December 2021, approval was received from the UK Medicines and Healthcare Products Regulatory Agency (“MHRA”) of a license for manufacture at the Sawston facility of GMP (clinical grade) cell therapy products for compassionate use and trials. All costs associated with the facility buildout (Phase 1A) were reclassified from construction in progress to leasehold improvements, and the costs began to be amortized over the estimated useful life of the asset and/or leasehold lease. The Company incurred additional construction works related to Phase 1B build out during the year ended December 31, 2022, which was completed and placed in use in 2023. F-11
[294]: Table of Contents NORTHWEST BIOTHERAPEUTICS, INC. Notes to the Consolidated Financial Statements Foreign Currency Translation and Transactions The Company has operations in the United Kingdom and Netherlands in addition to the U.S. The Company translated its assets and liabilities into U.S. dollars using end of period exchange rates, and revenues and expenses are translated into U.S. dollars using weighted average rates. Foreign currency translation adjustments are reported as a separate component of accumulated other comprehensive income (loss) within stockholders’ equity deficit. The Company converts receivables and payables denominated in other than the Company’s functional currency at the exchange rate as of the balance sheet date. The resulting transaction exchange gains or losses related to intercompany receivable and payables, are included in other income and expense. Comprehensive Loss The Company reports comprehensive loss and its components in its consolidated financial statements. Comprehensive loss consists of net loss and foreign currency translation adjustments, affecting stockholders’ equity deficit that, under U.S, GAAP, is excluded from net loss. Revenue Recognition The Company recognizes revenue in accordance with the terms stipulated under the applicable service contract. In various situations, the Company receives certain credits against invoices for manufacturing of patient treatments by its contract manufacturer. These payments are assessed and recognized in accordance with ASC 606 in the period when the performance obligation had been met. Accrued Outsourcing Costs Substantial portions of our preclinical studies and clinical trials are performed by third-party laboratories, medical centers, contract research organizations and other vendors (collectively “CROs”). These CROs generally bill monthly or quarterly for services performed, or bill based upon milestones achieved. For clinical studies, expenses are accrued when services are performed. The Company monitors patient enrollment, the progress of clinical studies and related activities through internal reviews of data that is tracked by the CROs under contractual arrangements, correspondence with the CROs and visits to clinical sites. Research and Development Costs Research and development costs are charged to operations as incurred and consist primarily of clinical trial related costs (including costs for collection, validation and analysis of trial results), related party manufacturing costs, consulting costs, contract research and development costs, clinical site costs and compensation costs. Income Taxes The Company evaluates its tax positions and estimates its current tax exposure along with assessing temporary differences that result from different book to tax treatment of items not currently deductible for tax purposes. These differences result in deferred tax assets and liabilities on the Company’s Consolidated Balance Sheets, which are estimated based upon the difference between the financial statement and tax bases of assets and liabilities using the enacted tax rates that will be in effect when these differences reverse. In general, deferred tax assets represent future tax benefits to be received when certain expenses previously recognized in the Company’s Consolidated Statements of Comprehensive Loss become deductible expenses under applicable income tax laws or loss or credit carryforwards are utilized. Accordingly, realization of the Company’s deferred tax assets is dependent on future taxable income against which these deductions, losses and credits can be utilized. F-14
