[712]: Use of Estimates The preparation of Consolidated Financial Statements in conformity with GAAP requires management to make certain estimates and assumptions that affect the reported amounts of assets and liabilities and disclosure of contingent liabilities at the date of the Consolidated Financial Statements and the reported amounts of revenues and expenses during the reporting periods. Significant estimates include, but are not limited to, the allocation of purchase price between tangible and intangible assets acquired and liabilities assumed, the fair value of long-lived assets and goodwill utilized in impairment assessments, the depreciable lives of rental property, the amortizable lives of intangible assets and liabilities, the probability of collecting outstanding and future lease payments, the fair value of the earnout liability, and the fair value of the Company’s interest rate swap agreements. Accordingly, actual results may differ from those estimates.
