[800]: NOTE 3— NET INCOME (LOSS) PER SHARE
[801]: Basic net income (loss) per share is computed by dividing net income (loss) for the period by the weighted average number of common shares outstanding during the period. Diluted net income (loss) per share is computed by dividing net income (loss) for the period by the weighted average number of shares of common stock and potentially dilutive common stock outstanding for the period. The dilutive effect of outstanding equity incentive awards is reflected in diluted net income (loss) per share by application of the treasury stock method. The calculation of diluted net income (loss) per share excludes all anti-dilutive common shares. During periods when we report net loss, diluted net loss per share is the same as basic net loss per share because the effects of potentially dilutive items would decrease the net loss per share.
[431]: • Revenues from other value added services: Net revenues derived primarily from revenue earned through partnerships, referral fees, subscription fees, gateway fees, and other services we provide to our merchants and consumers. We also earn revenues from interest and fees earned on our portfolio of loans receivable, and interest earned on certain assets underlying customer balances.
[432]: Our revenues can be significantly impacted by a number of factors, including the following:
[433]: • The mix of merchants, products, and services;
[434]: • The mix between domestic and cross-border transactions;
[435]: • The geographic region or country in which a transaction occurs; and
[436]: • The amount of our loans receivable outstanding with merchants and consumers.
