[692]: Operational Growth
[693]: We believe that it is important to not only understand overall revenue and earnings growth, but also “operational growth.” Operational growth is a non-GAAP financial measure defined as revenue or earnings growth excluding the impact of foreign exchange. This measure provides information on the change in revenue and earnings as if foreign currency exchange rates had not changed between the current and prior periods to facilitate a period-to-period comparison. We believe this non-GAAP measure provides a useful comparison to previous periods for the company and investors, but should not be viewed as a substitute for U.S. GAAP reported growth.
[694]: Adjusted Net Income and Adjusted Earnings Per Share
[695]: Adjusted net income and the corresponding adjusted earnings per share (EPS) are non-GAAP financial measures of performance used by management. We believe these financial measures are useful supplemental information to investors when considered together with our U.S. GAAP financial measures. We report adjusted net income to portray the results of our major operations, and the discovery, development, manufacture and commercialization of our products, prior to considering certain income statement elements. We define adjusted net income and adjusted EPS as net income attributable to Zoetis and EPS before the impact of purchase accounting adjustments, acquisition-related costs and certain significant items.
