[637]: We derive revenue principally through monthly charges to residential customers of our broadband, video, telephony and mobile services. We also derive revenue from DVR, VOD, pay-per-view, installation and home shopping commissions. Our residential broadband, video, telephony and mobile services accounted for approximately 41%, 33%, 3%, and 1% respectively, of our consolidated revenue for the year ended December 31, 2023. We also derive revenue from the sale of a wide and growing variety of products and services to both large enterprise and SMB customers, including broadband, telephony, networking, video and mobile services. For the year ended December 31, 2023, 16% of our consolidated revenue was derived from these business services. In addition, we derive revenue from the sale of advertising inventory available on the programming carried on our cable television systems, as well as other systems (linear revenue), digital advertising, data analytics and affiliation fees for news programming, which accounted for approximately 5% of our consolidated revenue for the year ended December 31, 2023. Our other revenue, which includes mobile equipment revenue, for the year ended December 31, 2023 accounted for approximately 1% of our consolidated revenue.
