[1575]: Table of Contents from) income taxes included in the consolidated statements of operations and comprehensive loss represents the tax impact from operating activities in the United States, which has generated taxable income based on intercompany service arrangements. Deferred tax assets benefitted in the United States do not have a valuation allowance against them because of profits that will be generated by an intercompany service agreement. ​ Starting in 2022, amendments to Section 174 of the Internal Revenue Code of 1986, as amended (“IRC”), eliminated the option to immediately deduct research and development expenditures in the tax year that such costs are incurred. In accordance with the amendments, beginning on January 1, 2022, and continuing until the end of the second quarter of 2023, these research and development costs were capitalized by the Company and amortized over either a five- or 15-year period, depending on the location of the activities performed. During the year ended December 31, 2023, the Company completed an assessment, inclusive of an external tax analysis, and concluded that it is not required to capitalize certain research and development expenses incurred by its U.S. subsidiary associated with contractual research services performed on behalf of its U.K. subsidiary pursuant to an intercompany service arrangement because its U.S. subsidiary does not retain any ownership or rights in the underlying intellectual property resulting from the research services. The change in estimate upon the completion of this analysis resulted in the recognition of an income tax provision of $ 2.4 million during the year ended December 31, 2023. The Company's income tax benefit recognized during the years ended December 31, 2022 and 2021 is mainly the result of deferred tax assets benefitted in the U.S. that do not have a valuation allowance against them because of profits that will be generated by an intercompany service agreement. The Company regularly assesses its ability to realize its deferred tax assets. Assessing the realization of deferred tax assets requires significant judgment. In determining whether its deferred tax assets are more likely than not realizable, the Company evaluated all available positive and negative evidence, and weighed the evidence based on its objectivity. After consideration of the evidence, including the Company's history of cumulative net losses in the U.K., the Company has concluded that it is more likely than not that the Company will not realize the benefits of its U.K. deferred tax assets and accordingly the Company has provided a valuation allowance for the full amount of the net deferred tax assets in the U.K. The Company has considered its history of cumulative net profits in the United States and estimated future taxable income and has concluded that it is more likely than not that the Company will realize the benefits of its United States deferred tax assets and has not provided a valuation allowance against the net deferred tax assets in the United States. The valuation allowance increased in the year ended December 31, 2023 by $ 26.5 million due to the corresponding increase in U.K. deferred tax assets, primarily due to operating loss carryforwards generated during the year that were not surrendered for research credit utilization. The Company recorded a valuation allowance against all of its U.K. deferred tax assets as of December 31, 2023 and 2022. The Company intends to continue to maintain a full valuation allowance on its U.K. deferred tax assets until there is sufficient evidence to support the reversal of all or some portion of these allowances. The release of the valuation allowance would result in the recognition of certain deferred tax assets and an increase to the benefit for income taxes for the period the release is recorded. However, the exact timing and amount of the valuation allowance release are subject to change on the basis of the level of profitability that the Company is able to actually achieve. The provision for (benefit from) income taxes shown on the consolidated statements of operations differs from amounts that would result from applying the statutory tax rates to income before taxes primarily because of certain permanent expenses that were not deductible and U.K., U.S. federal and state research and development credits, as well as the application of valuation allowances against the U.K. deferred tax assets. As of December 31, 2023, the Company had $ 266.2 million of U.K. operating loss carryforwards that have an indefinite life. The Company recognizes, in its consolidated financial statements, the effect of a tax position when it is more likely than not, based on the technical merits, that the position will be sustained upon examination. The Company had no uncertain tax positions during the years ended of December 31, 2023 and 2022. There are no amounts of interest or penalties recognized in the consolidated statement of operations or accrued on the consolidated balance sheet for any period presented. The Company does not expect any material changes in these uncertain tax benefits within the next 12 months. F-45
