[997]: Notes Receivable
[998]: The Company has provided financing in the form of notes receivable loans to franchisees to support the development of hotel properties in strategic markets. The Company's credit quality indicator is the level of security in the note receivable.
[683]: Results of Operations - Royalty, licensing and management fees, operating income, net income, and diluted earnings per share ("EPS") represent the key measures of our financial performance. These measures are primarily driven by the operations of our hotel franchise system and, therefore, our analysis of the Company's operations is primarily focused on the size, performance, and the potential growth of the hotel franchise system as well as our variable overhead costs.
[684]: Our discussion of our results of operations excludes reimbursable franchise marketing and reservation system revenues and expenses and the management agreement cost reimbursements and expenses included in the Company's other revenues from franchised and managed properties and other expenses from franchised and managed properties. The Company's franchise agreements require the payment of marketing and reservation system fees to be used by the Company for the expenses associated with providing franchise services such as national marketing, media advertising, and central reservation systems. The Company is obligated to expend the marketing and reservation system fees it collects from its franchisees in accordance with the franchise agreements. Furthermore, the franchisees are required to reimburse the Company for any deficits generated by these marketing and reservation system activities. Over time, the Company expects the cumulative revenues and expenses of reimbursable components to break even and, therefore, no income or loss will be generated from the reimbursable marketing and reservation system activities. Additionally, the legacy Radisson Hotels Americas management agreements include cost reimbursements, primarily related to payroll costs at managed hotels where the Company is the employer. As a result, the Company generally excludes the other revenues and other expenses from franchised and managed properties from the analysis of its operations.
