[852]: NOTE 1. BUSINESS AND SUMMARY OF SIGNIFICANT ACCOUNTING POLICIES
[853]: Business —Danaher Corporation (“Danaher” or the “Company”) designs, manufactures and markets professional, medical and industrial products and services, which are typically characterized by strong brand names, innovative technology and major market positions.  As of December 31, 2023, the Company operates in three business segments: • The Biotechnology segment includes the bioprocessing and discovery and medical businesses and offers a broad range of equipment, consumables and services that are primarily used by customers to advance and accelerate the research, development, manufacture and delivery of biological medicines.  The biotherapeutics that the Company’s solutions support range from replacement therapies such as insulin, vaccines, recombinant proteins and other biologic drugs, to novel cell, gene, mRNA and other nucleic acid therapies. • The Life Sciences segment offers a broad range of instruments, consumables, services and software that are primarily used by customers to study genomics and the basic building blocks of life, including DNA and RNA, nucleic acid, proteins, metabolites and cells, in order to understand the causes of disease, identify new therapies, and test and manufacture new drugs, vaccines and gene editing technologies.  Additionally, the segment provides products and consumables used to filter and remove contaminants from a variety of liquids and gases in many end-market applications. • The Diagnostics segment offers clinical instruments, consumables, software and services that hospitals, physicians’ offices, reference laboratories and other critical care settings use to diagnose disease and make treatment decisions. Refer to Notes 2 and 3 for a discussion of significant acquisitions and discontinued operations, including the disposal of the Company’s former Environmental & Applied Solutions segment. Accounting Principles —The accompanying financial statements have been prepared in accordance with accounting principles generally accepted in the United States (“GAAP”).  The Consolidated Financial Statements include the accounts of the Company and its subsidiaries.  All intercompany balances and transactions have been eliminated upon consolidation.  The Consolidated Financial Statements also reflect the impact of noncontrolling interests.  Noncontrolling interests do not have a significant impact on the Company’s consolidated results of continuing operations, therefore earnings attributable to noncontrolling interests for continuing operations are not presented separately in the Company’s Consolidated Statements of Earnings.  Earnings attributable to noncontrolling interests have been reflected in selling, general and administrative expenses and were insignificant in all periods presented.  Reclassifications of certain prior year amounts have been made to conform to the current year presentation. Use of Estimates —The preparation of these financial statements in conformity with accounting principles generally accepted in the United States requires management to make estimates and judgments that affect the reported amounts of assets, liabilities, revenues and expenses, and related disclosure of contingent assets and liabilities.  The Company bases these estimates on historical experience, the current economic environment and on various other assumptions that are believed to be reasonable under the circumstances.  However, uncertainties associated with these estimates exist and actual results may differ materially from these estimates. Cash and Equivalents —The Company considers all highly liquid investments with a maturity of three months or less at the date of purchase to be cash equivalents. Accounts Receivable and Allowances for Doubtful Accounts —All trade accounts, contract and finance receivables are reported on the accompanying Consolidated Balance Sheets adjusted for any write-offs and net of allowances for doubtful accounts.  The allowances for doubtful accounts represent management’s best estimate of the expected future credit losses from the Company’s trade accounts, contract and finance receivable portfolios.  Determination of the allowances requires management to exercise judgment about the timing, frequency and severity of credit losses that could materially affect the provision for credit losses and, therefore, net earnings.  The Company regularly performs detailed reviews of its portfolios to determine if an impairment has occurred and evaluates the collectability of receivables based on a combination of various financial and qualitative factors that may affect customers’ ability to pay, including customers’ financial condition, collateral, debt-servicing ability, past payment experience and credit bureau information.  In circumstances where the Company is aware of a specific customer’s inability to meet its financial obligations, a specific reserve is recorded against amounts due to reduce the recognized receivable to the amount reasonably expected to be collected.  Additions to the allowances for doubtful accounts are charged to current period earnings, amounts determined to be uncollectible are charged directly against the allowances, while amounts recovered on previously written-off accounts increase the allowances.  If the financial condition of the Company’s customers were to deteriorate, resulting in an impairment of their ability to make payments, additional reserves would be required.  The Company does not believe that trade accounts receivable represents significant concentrations of credit risk because of the diversified portfolio of
