[941]: Valuation of Inventories Inventories are valued at the lower of cost or net realizable value, determined by the first-in, first-out method. Inventory is recorded using standard cost, including material, labor and overhead costs. The Company periodically reviews inventories for potential impairment and adjusts inventory for potentially excess or obsolete goods to state inventories at their net realizable value. Factors influencing these adjustments include quantities on hand and firm purchase commitments, expectations of future use, judgments based on quality control testing data and assessments of the likelihood of scrapping or obsoleting certain inventories based on future demand for its products and market conditions.
[838]: Critical Accounting Policies Involving Management Estimates and Assumptions
[839]: Our discussion and analysis of our financial condition and results of operations are based on our consolidated financial statements, which have been prepared in accordance with accounting principles generally accepted in the United States. The preparation of these consolidated financial statements requires management to make estimates and judgments that affect the reported amounts of assets, liabilities, revenues and expenses and the disclosure of contingent assets and liabilities in our consolidated financial statements. We evaluate our estimates and judgments on an ongoing basis. We base our estimates on historical experience and on various other factors that we believe are reasonable under the circumstances, the results of which form the basis for making judgments about our financial condition and results of operations that are not readily apparent from other sources. Actual results may differ materially from these estimates.
[1131]: Table element - Text before table: Purchase Obligations The Company has agreements with suppliers and other parties to purchase inventory, other goods and services and long-lived assets. Product inventory obligations consist primarily of purchase order commitments for raw materials used in the production of insulin pumps and cartridges, and finished goods infusion sets. Cancellation of outstanding purchase orders is generally allowed under the standard terms of our purchase order agreements, but may require payment of costs incurred through the date of cancellation. At December 31, 2023, obligations under our purchase agreements totaled approximately $ 189.2 million, of which approximately $ 181.5 million is scheduled to be received and become payable within one-year.
