[1294]: Revenue Recognition The Company analyzes its collaboration arrangements to assess whether they are within the scope of ASC 808, to determine whether such arrangements involve joint operating activities performed by parties that are both active participants in the activities and exposed to significant risks and rewards that are dependent on the commercial success of such activities. If the Company concludes that some or all aspects of the arrangement represent a transaction with a customer, the Company accounts for those aspects of the arrangement within the scope of ASC 606. For arrangements attributable to ASC 606, the Company recognizes revenue in a manner that depicts the transfer of control of a product or a service to a customer and reflects the amount of the consideration the Company is entitled to receive in exchange for such product or service. In doing so, the Company follows a five-step approach: (i) identify the contract with a customer, (ii) identify the performance obligations in the contract, (iii) determine the transaction price, (iv) allocate the transaction price to the performance obligations, and (v) recognize revenue when (or as) the customer obtains control of the product or service.
