[537]: The preparation of financial statements in conformity with generally accepted accounting principles ("GAAP") in the United States of America requires management to make estimates and assumptions that affect the reported amounts of assets and liabilities and disclosure of contingent assets and liabilities at the date of the financial statements and the reported amounts of revenues and expenses during the reporting period. Actual results could differ from those estimates.
[538]: Some of these estimates and assumptions include judgments on revenue recognition, estimates for common area maintenance and real estate tax accruals, provisions for uncollectible accounts, impairment of long-lived assets, the allocation of purchase price between tangible and intangible assets, capitalization of costs and fair value measurements. The Company’s significant accounting policies and estimates are described in more detail in Note 2—Summary of Significant Accounting Policies in the Company’s Notes to the Consolidated Financial Statements. However, the following policies are deemed to be critical:
