[1650]: Revenue Recognition
[1651]: We enter into collaboration agreements which are within the scope of Accounting Standards Codification, or ASC, Topic 606, Revenue from Contracts with Customers , or ASC 606, under which we license rights to certain of our product candidates and perform research and development services. The terms of these arrangements typically include payment of one or more of the following: non-refundable, upfront fees; reimbursement of research and
[1652]: 139
[1653]: development costs; development, regulatory, and commercial milestone payments; and royalties on net sales of licensed products.
[1654]: Under ASC 606, an entity recognizes revenue when its customer obtains control of promised goods or services, in an amount that reflects the consideration which the entity expects to receive in exchange for those goods or services. To determine the appropriate amount of revenue to be recognized for arrangements determined to be within the scope of ASC 606, we perform the following five steps: (i) identification of the promised goods or services in the contract; (ii) determination of whether the promised goods or services are performance obligations including whether they are distinct in the context of the contract; (iii) measurement of the transaction price, including the constraint on variable consideration; (iv) allocation of the transaction price to the performance obligations; and (v) recognition of revenue when (or as) we satisfy each performance obligation. We only apply the five-step model to contracts when it is probable that the entity will collect consideration it is entitled to in exchange for the goods or services it transfers to the customer. The areas of our revenue recognition policy that contain significant judgment include the determination of performance obligations, including customer options, the determination of estimated selling prices and the allocation of transaction price to our identified performance obligations.
