[682]: Revenue Recognition
[683]: Upstream Revenues
[684]: Upstream revenues include the sale of oil, gas and NGL production. Oil, gas and NGL sales are recognized when production is sold to a purchaser at a fixed or determinable price, delivery has occurred, control has transferred and collectability of the revenue is probable. Devon’s performance obligations are satisfied at a point in time. This occurs when control is transferred to the purchaser upon delivery of contract-specified production volumes at a specified point. The transaction price used to recognize revenue is a function of the contract billing terms. Revenue is invoiced, if required, by calendar month based on volumes at contractually based rates with payment typically received within 30 days of the end of the production month. Taxes assessed by governmental authorities on oil, gas and NGL sales are presented separately from such revenues in the accompanying consolidated statements of comprehensive earnings.
[691]: 55 Table of Contents Index to Financial Statements DEVON ENERGY CORPORATION AND SUBSIDIARIES NOTES TO CONSOLIDATED FINANCIAL STATEMENTS – (Continued)
[692]: Marketing Revenues
[693]: Marketing revenues are generated primarily as a result of Devon selling commodities purchased from third parties. Marketing revenues are recognized when performance obligations are satisfied. This occurs at the time contract-specified products are sold to third parties at a contractually fixed or determinable price, delivery occurs at a specified point or performance has occurred, control has transferred and collectability of the revenue is probable. The transaction price used to recognize revenue and invoice customers is based on a contractually stated fee or on a third party published index price plus or minus a known differential. Devon typically receives payment for invoiced amounts within 30 days. Marketing revenues and expenses attributable to oil, gas and NGL purchases are reported on a gross basis when Devon takes control of the products and has risks and rewards of ownership.
