[714]: Revenue Recognition
[715]: The Company’s revenue was $881.7 million for the year ended December 31, 2023. As described in Note 3 to the consolidated financial statements, management recognizes revenue when control of promised goods or services is transferred to the customer. The transfer of control generally occurs upon shipment when title and risk of loss pass to the customer. The vast majority of the Company’s revenue is generated from the sale of distinct products. Revenue is measured as the amount of consideration the Company expects to receive in exchange for such products, which is generally at contractually stated prices.
[716]: The principal consideration for our determination that performing procedures relating to revenue recognition is a critical audit matter is a high degree of auditor effort in performing procedures related to the Company’s revenue recognition.
[717]: Addressing the matter involved performing procedures and evaluating audit evidence in connection with forming our overall opinion on the consolidated financial statements. These procedures included testing the effectiveness of controls relating to the revenue recognition process. These procedures also included, among others, (i) testing the completeness, accuracy and existence of revenue recognized for a sample of revenue transactions by obtaining and inspecting source documents, including purchase orders, invoices, and proof of shipment and (ii) confirming a sample of outstanding customer invoice balances as of December 31, 2023 and, for confirmations not returned, obtaining and inspecting source documents, including invoices, proof of shipment, and subsequent cash receipts, where applicable.
