[1072]: 18. Segment Information
[1073]: Reportable Segments
[1074]: The Company’s Chief Operating Decision Maker (“CODM”) is the Chief Executive Officer. The CODM utilizes financial information to make decisions about allocating resources and assessing performance for the entire Company. The Company evaluates the performance of, and allocates resources to, its segments based on revenue, gross profit and operating profit. The Company’s reportable segments have been identified based on commonality and adjacency of technologies, applications and customers amongst the Company’s individual product lines. The Company determined that disclosing revenue by specific product was impracticable due to the highly customized and extensive portfolio of technologies offered to customers.
[1075]: Based upon the information provided to the CODM, the Company has determined it operates in three reportable segments: Precision Medicine and Manufacturing, Medical Solutions, and Robotics and Automation. The reportable segments and their principal activities are summarized below:
[779]: Advertising Costs Advertising costs are expensed as incurred and are included in selling, general and administrative expenses in the consolidated statement of operations. Advertising costs were not material for 2023, 2022 and 2021.
[780]: Restructuring, Acquisition and Related Costs The Company accounts for its restructuring activities in accordance with the provisions of ASC 420, “Exit or Disposal Cost Obligations.” The Company makes assumptions related to the amounts of employee severance benefits and related costs, useful lives and residual value of long-lived assets, and discount rates. Estimates and assumptions are based on the best information available at the time the obligation is recognized. These estimates are reviewed and revised as facts and circumstances dictate. Acquisition related costs incurred to effect a business combination, including finders’ fees, legal, valuation and other professional or consulting fees, are expensed as incurred. Acquisition related costs also include expenses recognized under earn-out agreements in connection with acquisitions.
[513]: Overview of Financial Results
[514]: Total revenue for 2023 was $881.7 million, an increase of $20.8 million, or 2.4%, versus 2022. This increase was primarily due to increased demand in the medical markets and revenue from a prior year acquisition. The effect of our prior year acquisition resulted in an increase in revenue of $8.1 million, or 0.9%. In addition, foreign exchange rates favorably impacted our revenue by $1.3 million, or 0.2%, in 2023.
[515]: Operating income for 2023 was $110.5 million, an increase of $7.4 million, or 7.2%, versus 2022. This increase was primarily attributable to an increase in gross profit of $21.4 million primarily attributable to higher revenue and a decrease in amortization expense of $5.9 million, partially offset by an increase in restructuring, acquisition and related charges of $8.4 million, research and development and engineering (“R&D”) expenses of $5.9 million, and selling, general and administrative (“SG&A”) expenses of $5.6 million.
[516]: Basic earnings per common share (“basic EPS”) of $2.03 in 2023 decreased $0.05 from the basic EPS of $2.08 in 2022. Diluted earnings per common share (“diluted EPS”) of $2.02 in 2023 decreased $0.04 from the diluted EPS of $2.06 in 2022. The decreases in basic EPS and diluted EPS were primarily attributable to an increase in interest expense, partially offset by an increase in operating income and a decrease in income tax provision.
